# 2. Understanding React Hooks

React Hooks are functions that let you "hook into" React state and lifecycle features from function components. They were introduced in React 16.8 to allow function components to have state and side effects, which were previously only possible in class components.

## 2.1 Why Hooks?
- **Reuse Logic**: Hooks allow you to reuse stateful logic without changing your component hierarchy.
- **Simplify Components**: Complex components can be broken down into smaller functions using hooks.
- **No Classes**: You can use React features without writing classes.

## 2.2 Built-in Hooks
React provides several built-in hooks:
- `useState`: For managing state.
- `useEffect`: For side effects (like data fetching, subscriptions, etc.).
- `useContext`: For accessing context.
- `useReducer`: An alternative to `useState` for complex state logic.
- And more: `useCallback`, `useMemo`, `useRef`, etc.

# 3. Custom Hooks

A custom hook is a JavaScript function whose name starts with "use" and that may call other hooks. Custom hooks allow you to extract component logic into reusable functions.

## 3.1 Rules of Hooks
- Only call hooks at the top level (not inside loops, conditions, or nested functions).
- Only call hooks from React function components or other custom hooks.

## 3.2 When to Create a Custom Hook?
If you find yourself repeating the same logic in multiple components, that logic can be extracted into a custom hook.

# 4. Creating a Custom Hook: Step by Step

Let's create a custom hook for fetching data from an API.

## 4.1 Scenario
We want a hook that:
- Fetches data from a given URL.
- Returns the data, loading state, and error state.

## 4.2 Step 1: Create the Hook Function
Create a new file `useFetch.js` (or `.ts` for TypeScript).

```javascript
import { useState, useEffect } from 'react';

function useFetch(url) {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data when the component mounts or the URL changes
    const fetchData = async () => {
      try {
        const response = await fetch(url);
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const result = await response.json();
        setData(result);
        setError(null);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [url]); // Dependency array: re-run when URL changes

  return { data, loading, error };
}

export default useFetch;
```

## 4.3 Step 2: Use the Custom Hook in a Component
Now, use the hook in any functional component.

```javascript
import React from 'react';
import useFetch from './useFetch';

function DataComponent() {
  const { data, loading, error } = useFetch('https://api.example.com/data');

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h1>Data</h1>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
}

export default DataComponent;
```

## 4.4 Explanation
- **State Management**: The hook uses `useState` to manage data, loading, and error states.
- **Side Effect**: `useEffect` is used to perform the data fetching. It runs when the component mounts and whenever the `url` changes.
- **Return**: The hook returns an object containing `data`, `loading`, and `error` so the component can use them.

# 5. Testing Custom Hooks

Testing custom hooks is important. You can use `@testing-library/react-hooks` for this.

