在上一篇文章中，我们介绍了`Spring`的`IoC`容器，并且通过一个简单的例子，向大家展示了`IoC`容器是如何管理`Bean`的。在上一篇文章中，我们介绍了`Bean`的配置方式，包括`XML`配置和注解配置。在本文中，我们将继续介绍`Bean`的配置方式，包括`Java`配置和`Groovy`配置。

# 2. Java配置

`Java`配置是`Spring`4.0之后引入的新特性，它允许我们使用`Java`代码来配置`Spring`容器，而不需要使用`XML`配置文件。`Java`配置的核心是`@Configuration`注解和`@Bean`注解。

## 2.1 @Configuration注解

`@Configuration`注解用于标记一个类，表示这个类是一个配置类，`Spring`容器会扫描这个类，并且根据这个类中的配置来创建`Bean`。`@Configuration`注解的源码如下：

```java
@Target(ElementType.TYPE)
@Retention(RetentionPolicy.RUNTIME)
@Documented
@Component
public @interface Configuration {
    @AliasFor(annotation = Component.class)
    String value() default "";
}
```

从源码中可以看出，`@Configuration`注解本身也是一个`@Component`注解，因此，被`@Configuration`注解标记的类也会被`Spring`容器扫描到，并且注册为`Bean`。

## 2.2 @Bean注解

`@Bean`注解用于标记一个方法，表示这个方法会返回一个`Bean`，并且这个`Bean`会被`Spring`容器管理。`@Bean`注解的源码如下：

```java
@Target({ElementType.METHOD, ElementType.ANNOTATION_TYPE})
@Retention(RetentionPolicy.RUNTIME)
@Documented
public @interface Bean {
    @AliasFor("name")
    String[] value() default {};
    @AliasFor("value")
    String[] name() default {};
    Autowire autowire() default Autowire.NO;
    String initMethod() default "";
    String destroyMethod() default "";
}
```

`@Bean`注解有几个重要的属性：

- `value`和`name`：用于指定`Bean`的名称，如果不指定，默认使用方法的名称作为`Bean`的名称。
- `autowire`：用于指定`Bean`的自动装配模式，默认是`Autowire.NO`，表示不自动装配。
- `initMethod`：用于指定`Bean`的初始化方法。
- `destroyMethod`：用于指定`Bean`的销毁方法。

## 2.3 示例

下面我们通过一个简单的例子来演示如何使用`Java`配置来配置`Spring`容器。

首先，我们创建一个`User`类：

