// 题目要求：给定两个长度为n的数组a和b，通过交换a中的元素，使得a和b的每个位置上的元素差的绝对值之和最小，求这个最小值。
// 思路：贪心策略，将两个数组都排序，然后对应位置相减取绝对值求和即可。
// 证明：交换a的元素相当于对a进行重排，那么最小化|a_i - b_i|的和，最优策略是将a和b都排序后对应位置相减。
// 因为如果存在逆序（即a_i > a_j 而 b_i < b_j），那么交换a_i和a_j会使得和更小或不变（绝对值性质）。

// 注意：使用long long存储结果，因为n最大为10^5，每个元素最大10^9，总和可能达到10^14。

#include <iostream>
#include <vector>
#include <algorithm>
#include <cmath>
using namespace std;

int main() {
    int n;
    cin >> n;
    vector<long long> a(n), b(n);
    for (int i = 0; i < n; i++) cin >> a[i];
    for (int i = 0; i < n; i++) cin >> b[i];

    sort(a.begin(), a.end());
    sort(b.begin(), b.end());

    long long ans = 0;
    for (int i = 0; i < n; i++) {
        ans += abs(a[i] - b[i]);
    }
    cout << ans << endl;
    return 0;
}
